Romania Dosar will help you track the status of your application (dosar) at the Ministry of Justice of Romania.
Unlike its counterparts, the application works with its own database, which is more complete and accurate. 

In the app you can:
- Check the status of dosar by both Articolul 11 and Stadiu Dosar, without a long searching through the ANC website;
- Browse and download new orders in PDF;
- Track multiple dosars in one click! This is handy for family members or companies helping many clients;
- View statistics on applications submitted and positive resolutions for each year.

In future versions, we will add notifications of dosar status changes from the "My Dosar" list so you don't miss your exit to the order or have time to send your appeal!

The app is currently free and ad-free.
